    moveb vector_linef,%d0                  /* Get line-f vector */
    beqs addr_13c00                         /* linef vector already installed */
    movel #100,%sp@-
    movew #72,%sp@-
    trap #1                                 /* dos_allocate */
    addql #6,%sp
